import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the search input using placeholder attribute (different selector)
    await page.waitForSelector('input[placeholder="Search Amazon"]', { timeout: 5000 });

    // Focus and type into the search input
    const searchInput = await page.$('input[placeholder="Search Amazon"]');
    await searchInput.click();
    await searchInput.type('iphone', { delay: 80 });

    // Take screenshot after typing
    const step2 = path.join(screenshotsDir, 'step_2_typed.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Wait for the search suggestions dropdown to appear (by class, not ID)
    await page.waitForSelector('.search-suggestions', { timeout: 5000 });

    // Take screenshot of suggestions
    const step3 = path.join(screenshotsDir, 'step_3_suggestions.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract the suggestion texts (use .suggestion-item elements)
    const suggestions = await page.$$eval('.suggestion-item', els => els.map(e => e.textContent.trim()));

    // Click the first suggestion using nth-of-type CSS selector
    const firstSuggestion = await page.$('.suggestion-item:nth-of-type(1)');
    if (firstSuggestion) {
      await firstSuggestion.click();
    }

    // Wait for the search results heading (use text selector for "Search Results")
    await page.waitForSelector('text=Search Results', { timeout: 5000 });

    // Take screenshot of the search results
    const step4 = path.join(screenshotsDir, 'step_4_results.png');
    await page.screenshot({ path: step4 });
    screenshots.push(step4);

    // Extract the number of results found (from .results-count)
    let resultsCount = '';
    try {
      resultsCount = await page.$eval('.results-count', el => el.textContent.trim());
    } catch (e) {
      resultsCount = 'Not found';
    }

    return {
      success: true,
      action: "Tested search autocomplete: typed query, verified suggestions, selected suggestion, and confirmed search results.",
      extractedData: {
        suggestions,
        resultsCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
